import React, { useState } from "react";
import ContactUs from "./ContactUs";
import { App } from "./App";
import Home from "./Home";
import { Route, BrowserRouter  } from 'react-router-dom';
import { Link } from 'react-router-dom';
import NavBar from "./NavBar";
import SearchForm from "./SearchForm";



function DisplayVideos (){
  const [active, setActive ]= useState('home');


  return  (
    <BrowserRouter>
      <nav className="nav">


     <ul>


       <li>

           <Link to="#home" onClick={() => setActive('home')} smooth >Home</Link>

       </li>


       <li>

       <Link to="#serch"  onClick={() => setActive('contact')} smooth >Search</Link>

       </li>

       <li>
       <Link to="#contact"  onClick={() => setActive()}  smooth >Contact</Link>

       </li>
     </ul>

    </nav>

    {active === 'home' &&  <Home />}
    {active === 'contact' &&  <ContactUs />}
    {active === 'search' &&  <SearchForm />}




    </BrowserRouter>
  )

}

export default DisplayVideos
